//sewma, rewma, rttr, slow, win, intersend
bool Controller::apply_rules() {
  /*double sewma, rewma, rttr, slow;
  sewma=0.5; rewma=0.5, rttr=0.5; slow=0.5;
  int *win;
  int *intersend;*/

  double l_sewma, l_rewma, l_rttr, l_slow, h_sewma, h_rewma, h_rttr, h_slow, usage, w_mul, new_intersend;
  int w_add;
  //char *rule1 = "[{(lo=< sewma=0.000000 rewma=0.000000 rttr=0.000000 slowrewma=0.000000 >, hi=< sewma=0.708020 rewma=0.775167 rttr=1.022036 slowrewma=163840.000000 >)} gen=0 usage=0.0010 => (win=10 + 0.989800 * win, intersend=7.989700)]";
  for (int i = 0; i < 190; i++) {
    if (i == 102) {
      continue;
    }
    sscanf(rules[i], "[{(lo=< sewma=%lf rewma=%lf rttr=%lf slowrewma=%lf >, hi=< sewma=%lf rewma=%lf rttr=%lf slowrewma=%lf >)} gen=0 usage=%lf => (win=%d + %lf * win, intersend=%lf)]", 
                                &l_sewma, &l_rewma,&l_rttr,      &l_slow,          &h_sewma, &h_rewma,&h_rttr,      &h_slow,            &usage,     &w_add,&w_mul,            &new_intersend );
    if ((l_sewma <= this->s_ewma && this->s_ewma < h_sewma) && (l_rewma <= this->r_ewma && this->r_ewma < h_rewma) && (l_rttr <= this->rtt_ratio && this->rtt_ratio < h_rttr) && (l_slow <= this->r_slowewma && this->r_slowewma < h_slow)) {
      this->cur_win = (uint64_t) (w_add + (uint64_t)(this->cur_win * w_mul));
      if (this->cur_win < 1) this->cur_win = 1;
      this->intersend = (uint64_t) new_intersend;
      return true;
    }
  }
  return false;
}

